import axios from "axios";
import { useEffect, useState } from "react";

interface toDo {
  id: number
  title: string
  raiting: number
}

const App = () => {

  const [films, setFilms] = useState<toDo[]>([]);

  const fetchFilms = async () => {
    const response = await axios.get('http://localhost:5000/films');
    setFilms(response.data);
  }

  useEffect(() => {
    fetchFilms();
  }, []);

  return (
    <div className='App'>
      <header className='App-header'>
        <h1>Главная</h1>
        <input/>
        <button>Добавить задачу</button>
        <h1>Список задач</h1>
        <button>Все задачи</button><button>Активные задачи</button><button>Завершенные задачи</button>
      </header>
    </div>
  )
}

export default App;
